import React from 'react';
import { Link } from 'react-router-dom';

const AdminDashboardPage = () => {
    return (
        <div className="container mx-auto px-6 py-8">
            <h1 className="text-3xl font-bold text-gray-800 mb-6">Admin Dashboard</h1>

            <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6">
                {/* Card for Product Management */}
                <Link to="/admin/products" className="block p-6 bg-white rounded-lg shadow-md hover:shadow-xl transition-shadow">
                    <h2 className="text-xl font-semibold text-gray-700">Manage Products</h2>
                    <p className="mt-2 text-gray-600">Add, edit, and delete products from the store.</p>
                </Link>

                {/* Card for Order Management */}
                <Link to="/admin/orders" className="block p-6 bg-white rounded-lg shadow-md hover:shadow-xl transition-shadow">
                    <h2 className="text-xl font-semibold text-gray-700">Manage Orders</h2>
                    <p className="mt-2 text-gray-600">View and update customer order statuses.</p>
                </Link>

                {/* Card for User Management */}
                <Link to="/admin/users" className="block p-6 bg-white rounded-lg shadow-md hover:shadow-xl transition-shadow">
                    <h2 className="text-xl font-semibold text-gray-700">Manage Users</h2>
                    <p className="mt-2 text-gray-600">View and manage customer accounts.</p>
                </Link>
            </div>
        </div>
    );
};

export default AdminDashboardPage;
